import React from 'react';
import ContentLoader from 'react-content-loader';

const LoaderCard = () => (
  <ContentLoader
    speed={2}
    width={476}
    height={124}
    viewBox="0 0 476 124"
    backgroundColor="#f3f3f3"
    foregroundColor="#ecebeb"
    {...props}
  >
    <rect x="131" y="-25" rx="23" ry="23" width="183" height="229" />
    <rect x="88" y="62" rx="0" ry="0" width="0" height="2" />
  </ContentLoader>
);

export default LoaderCard;
